  const arrayConteudo = ['conteudo 1', 'conteudo 2', '...', 'conteudo N'];
  return (
    <div className='classPage'>
      <Header />
      <SideBar listaConteudo={ arrayConteudo } aula='transformador'/>
      <div>
      <h2> Por que isso é importante?</h2>
      <p>
        Além do grande uso no mercado, o princípio do transformador será visto frequêntimente ao longo de nosso curso,
        assim para que haja uma maior familiaridade, com os próximos conteúdos.
      </p>
      </div>
    </div>
  );
}

export default porQue1;
